  false,\n\t\"url\": null,\n\t\"notes\": \"The Quarterly Census of Employment and
  Wages (QCEW) program serves as a near census of employment and wage information.
  The program produces a comprehensive tabulation of employment and wage information
  for workers covered by Connecticut Unemployment Insurance (UI) laws and Federal
  workers covered by the Unemployment Compensation for Federal Employees (UCFE) program.
  Data on the number of establishments, employment, and wages are reported by industry
  for Connecticut and for the counties, towns and Labor Market Areas (LMAs) and Workforce
  Investment Areas (WIAs).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
